import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {
      ping: []
    }
  }

  getUsers = async () => {
    var response = await fetch(
    'api/ping',
    {
      method: 'get'
    }
    )

    var responsejson = await response.json();
    this.setState({
      ping: responsejson
    })
  }

  render() {
    return (
      <div className='App'>
        <button onClick={this.getUsers}>Ping</button>
        </div>
    )
  }
}

export default App;
